import { Carousel } from 'react-bootstrap';
import React, { Component } from 'react';

var firebase = require("firebase/app");
require("firebase/database");


export default class MeuCarrossel extends React.Component {

	returnJson() {
		var config = {
			apiKey: "AIzaSyC-p659q-u619AFH_ahoq_jsy2EzAsL_Uw",
			authDomain: "portfolio-cbb4c.firebaseapp.com", 
			databaseURL: "https://portfolio-cbb4c.firebaseio.com",
			storageBucket: "portfolio-cbb4c.appspot.com",
		};
		firebase.initializeApp(config);

		var database = firebase.database();
	}

	render() {
		let width = 259;
		let height = 194;
		return (
			<div className="col-md-6 col-md-offset-3">
				<Carousel>
					<Carousel.Item>
						<img width={width} height={height} alt="900x500" src={require('./img/produto1.jpg')} />
						<Carousel.Caption>
							<h3>First slide label</h3>
							<p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
						</Carousel.Caption>
					</Carousel.Item>
					<Carousel.Item>
						<img width={width} height={height} alt="900x500" src={require('./img/produto2.jpg')} />
						<Carousel.Caption>
							<h3>Second slide label</h3>
							<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
						</Carousel.Caption>
					</Carousel.Item>
					<Carousel.Item>
						<img width={width} height={height} alt="900x500" src={require('./img/produto3.jpg')} />
						<Carousel.Caption>
							<h3>Third slide label</h3>
							<p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
						</Carousel.Caption>
					</Carousel.Item>
				</Carousel>
			</div>
		);
	}
}
